import React from 'react';
import { Text, View, StyleSheet } from 'react-native';

const BoxModelScreen = () => {
  return (
      <View>
        <Text>Box Model Styling</Text>
        <View style={styles.viewStyle}>
          <Text style={styles.textStyle}>Box Model Screen</Text>
        </View>

        <Text>FlexBox Styling</Text>
        <View style={styles.flexStyle}>
          <Text style={styles.flexTextStyle}>Child #1</Text>
          <Text style={styles.flexTextStyle}>Child #2</Text>
          <Text style={styles.flexTextStyle}>Child #3</Text>
        </View>
      </View>
  );
};

const styles = StyleSheet.create({
  viewStyle: {
    borderWidth: 2,
    borderColor: 'black',
    marginBottom: 20
  },
  textStyle: {
    borderWidth: 1,
    borderColor: 'red',
    margin: 20
  },
  flexStyle: {
    borderWidth: 2,
    borderColor: 'black',
    alignItems: 'center',
    flexDirection: 'row',
    justifyContent: 'center'
  },
  flexTextStyle: {
    borderWidth: 1,
    borderColor: 'red',
  }
});

export default BoxModelScreen;
